create database if not exists `keymanager`;

USE `keymanager`;

/*Table structure for table `key_code_format` */

DROP TABLE IF EXISTS `key_code_format`;

CREATE TABLE `key_code_format` (
  `key_code_format_id` int(11) NOT NULL auto_increment,
  `key_code_format_name` varchar(45) default NULL,
  `key_code_format_description` varchar(255) default NULL,
  PRIMARY KEY  (`key_code_format_id`),
  UNIQUE KEY `key_code_format_name` (`key_code_format_name`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

/*Data for the table `key_code_format` */

insert  into `key_code_format`(`key_code_format_id`,`key_code_format_name`,`key_code_format_description`) values (1,'PRONTO','Key Codes in PRONTO format'),(2,'RAW','Key Codes in RAW format');

/*Table structure for table `remote_type` */

DROP TABLE IF EXISTS `remote_type`;

CREATE TABLE `remote_type` (
  `remote_type_id` int(11) NOT NULL auto_increment,
  `remote_type_name` varchar(45) NOT NULL,
  `remote_type_description` varchar(45) default NULL,
  PRIMARY KEY  (`remote_type_id`),
  UNIQUE KEY `remote_type_name` (`remote_type_name`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

/*Data for the table `remote_type` */

insert  into `remote_type`(`remote_type_id`,`remote_type_name`,`remote_type_description`) values (1,'COMCAST','Comcast Silver Remote'),(2,'SA','SA Legacy Remotes'),(3,'COMCAST_XMP','XMP Remotes'),(4,'DTA','Remote for all DTA Devices'),(5,'TV_PANASONIC','PANASONIC TV Remote'),(6,'VDO_SRC_CONVERTER','Remote for video source switches');


