/*Table structure for table `key_layout` */

DROP TABLE IF EXISTS `key_layout`;

CREATE TABLE `key_layout` (
  `key_layout_id` int(11) NOT NULL auto_increment,
  `FK_remote_type_id` int(11) NOT NULL,
  `FK_key_code_format_id` int(11) NOT NULL,
  `key_name` varchar(45) NOT NULL,
  `panel` int(11) NOT NULL default '0',
  `row_num` int(11) NOT NULL default '0',
  `column_num` int(11) NOT NULL default '0',
  `fore_color` varchar(45) default NULL,
  `back_color` varchar(45) default NULL,
  PRIMARY KEY  (`key_layout_id`),
  UNIQUE KEY `unique_layouts` (`FK_remote_type_id`,`FK_key_code_format_id`,`key_name`),
  KEY `FK_remote_type_kl` (`FK_remote_type_id`),
  KEY `FK_key_code_format_kl` (`FK_key_code_format_id`),
  KEY `FK126B410A9470A0C2` (`FK_remote_type_id`),
  KEY `FK126B410ABBCD9A6D` (`FK_key_code_format_id`),
  CONSTRAINT `FK126B410A9470A0C2` FOREIGN KEY (`FK_remote_type_id`) REFERENCES `remote_type` (`remote_type_id`),
  CONSTRAINT `FK126B410ABBCD9A6D` FOREIGN KEY (`FK_key_code_format_id`) REFERENCES `key_code_format` (`key_code_format_id`),
  CONSTRAINT `FK_key_code_format_kl` FOREIGN KEY (`FK_key_code_format_id`) REFERENCES `key_code_format` (`key_code_format_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_remote_type_kl` FOREIGN KEY (`FK_remote_type_id`) REFERENCES `remote_type` (`remote_type_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=319 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

